import React from "react";
import doctorImg from '../assets/doctor-main.png'

const HomeComponent = () => {
  return (
    <>
      <div className="container main-slider">
        <div className="main-heading">
          <p className="main-display">Deliver accurate and timely health care.</p>
          <p className="main-title">
            A trustworthy healthcare campanion. We really care about your health
            and consiousness.{" "}
          </p>
        </div>
        <div className="main-heading main-svg">
          <svg width="647" height="546" viewBox="0 0 647 546" fill="none" xmlns="http://www.w3.org/2000/svg">
            <clipPath id="DoctorImg">
            <path d="M3.24088 258.886C-0.556106 166.441 76.4479 93.4898 150.806 40.1219C345.401 -73.6711 343.925 107.366 520.58 140.683C637.51 162.736 656.495 273.441 637.51 353.714C618.525 433.986 426.95 546.015 315.629 542.487C204.308 538.958 7.98711 374.444 3.24088 258.886Z" stroke="#FF2E00" strokeWidth="5"/>
            <path d="M19.8399 282.579C16.2482 197.032 89.0886 129.525 159.426 80.1394C343.499 -25.1621 342.103 142.366 509.206 173.197C619.813 193.604 637.772 296.048 619.813 370.331C601.855 444.613 420.639 548.282 315.337 545.017C210.036 541.752 24.3295 389.513 19.8399 282.579Z" fill="#2EC5BC"/>
            </clipPath>
          </svg>
          <img src={doctorImg} alt="" clipPath />
        </div>
        <div className="image"></div>
      </div>
    </>
  );
};

export default HomeComponent;
